import React from "react";
import PropTypes from "prop-types";
import "../stylesheets/App.scss";
import Header from "./Header";
import Footer from "./Footer";
import Main from "./Main";
import Landing from "../Landing";

function App() {
  return (
    <>
      <Switch>
        <Header />
        <Landing />
        <Footer />

        <Header />
        <Main />
        <Footer />
      </Switch>
    </>
  );
}
export default App;
